INSERT INTO `news` (`id`, `news_header`, `news_content`, `template_name`, `added_at`) VALUES
(1, 'Początek działalności', 'Sex - Imperium rozpoczyna swoją działalność w sieci. W dniu rozpoczęcia udostępniamy użytkownikom filmy pornograficzne wraz ze standardowymi udogodnieniami takimi jak kategorie i profile gwiazd branży. \n           Oprócz tego wprowadziliśmy pewne innowacje - precyzyjną wyszukiwarkę oraz filmy z polskim tłumaczeniem. \n           Plany na najbliższą przyszłość to : zdjęcia porno, wyszukiwanie słowne, więcej filmów, i gwiazd oraz więcej opcji dla wyszukiwania zaawansowanego. \n           Plany na dalszą przyszłość : dział ogłoszeń dla osób zajmujących się prostytucją oraz sex-randki. Liczymy na to, że zostaniecie z nami. \n           Bardzo chętnie poznamy wasze uwagi na temat funkcjonowania portalu - wasza opinia ma dla nas duże znaczenie! Wystarczy skorzystać z formularza kontaktowego - link znajduje się na dole strony, w stopce. Życzymy miłego pobytu.', 'default_news', '2020-09-22');
INSERT INTO `pornstars` (`true_name`, `birth_place`, `years_active`, `official_website`, `description_beginning`, `votes_number`, `description_end`, `nickname`, `votes_summary`, `nationality_id`, `enhanced_tits`, `born`, `id`) VALUES
('Julia Tavella', 'Los Angeles U.S.A', 'od 1992', 'www.juliaannlive.com', 'Julia rozpoczęła działalność w branży erotycznej mając 18 lat. Najpierw pracowała jako fotomodelka. Po ukończeniu szkoły profesjonalnie walczyła w zapasach błotnych w Hollywood. Była również striptizerką. Po sukcesie rozbieranego przedstawienia pt. \"Blondage\" Julią zaczęli interesować się przedstawiciele branży porno. W 1993 zadebiutowała w filmie pt. \"Ukryta Obsesja\".', 1, 'Julia zalicza się do jednych z najbardziej znanych i rozpoznawanych aktorek XXX. To ścisła czołówka gwiazd porno a w szczególności aktorek typu MILF. Kilkukrotnie otrzymywała nagrody dla najlepszych kuguarzyc roku. Ma na koncie około 800 filmów. Wcielała się w role pielęgniarki, zakonnicy, nauczycielki, matki, policjantki i wielu innych. Wraz ze swoimi sztucznie powiększonymi cyckami każdego dnia przyczynia się do tysięcy spustów na całym świecie. Gdy czytasz ten tekst setki napaleńców walą konika podziwiając jej atuty. Pomimo iż ma już swoje lata, nie zwalnia tempa i nadal można ją podziwiać na sex-kamerkach. Jak wiele jej koleżanek po fachu nie należy do biednych. Dorobiła się między innymi wielkiej posiadłości i Bugatti.', 'Julia Ann', 0, 1, 1, '1969-10-08', 1),
('Marie Louise Hartman', 'Berkeley U.S.A', 'od 1984', 'www.nina.com', 'W 1982 podczas nauki w szkole pielęgniarskiej Nina zaczęła pracować jako striptizerka aby zarobić na edukację. Szybko wpadła w oko\r\nróżnej maści napaleńcom - między innymi Japończykom odwiedzającym bar w San Francisco. To poniekąd oni nadali jej pseudonim Nina - był dla nich łatwy do wymówienia. \r\nDo branży dołączyła w 1984 występując w \"Educating Nina\" - szybko zdobywając popularność. ', 0, 'Ninę śmiało można nazwać weteranką. Jest jedną z najbardziej\r\nrozpoznawalnych aktorek w branży(posiada również pseudonim \"bubble but\" - bąbelkowy tyłek) Wystąpiła w około 1000 filmów i co najważniejsze nadal jest aktywna.\r\nJej łapczywa, wiecznie niezaspokojona, biseksualna cipka niczym nie pogardzi. Począwszy od sztucznych kutasów poprzez inne pizdeczki na wielkich czarnych pałach skończywszy.\r\nKażdy walikonik musiał gdzieś, kiedyś słyszeć o Ninie. Jeśli jej nie poznałeś, koniecznie wyciągnij pyte ze spodni i nadrób zaległości.', 'Nina Hartley', 0, 1, 1, '1959-03-11', 2),
